def visual_timestamp():
    a = time.mktime(time.localtime())
    return str(int(a))


# load sequence data set
def load_data(file, sql='MBPs.csv', out='new_data'):
    with open(file, 'r') as u:
        lines = u.readlines()
    result = ''
    for i in lines:
        i = i.strip('\n')
        if i and i[0] == '>':
            result = result + '\n' + i + '\n'
        else:
            result = result + i
    result = result[1:].split('\n')
    sq_dic = {}
    for i in range(len(result)-1):
        if '>' in result[i]:
            sq_dic[result[i]] = result[i+1]
    if out not in os.listdir(data_path):
        os.makedirs(os.path.join(data_path, out))
    t = 0
    path = []
    for key in sq_dic:
        t += 1
        content = key + '\n' + sq_dic[key]
        save_path = os.path.join(os.path.join(data_path, out), str(t))
        index = key.split('-')[0][1:] + ',' + '-'.join(key.split('-')[1:]) + ',' + out + ',' + str(t)
        path.append(key.split('-')[0][1:] + '\t' + out + '\t' + str(t) + '\t' + '-'.join(key.split('-')[1:]))
        with open(save_path, 'w') as f:
            f.write(content)
        with open(os.path.join(list_path, sql), 'a') as f:
            f.write(index + '\n')
    return path


