def open_data(list_name):
    with open(os.path.join(list_path, list_name), 'r') as f:
        reader = csv.reader(f)
        result = list(reader)
    out = []
    for line in result:
        out.append('\t'.join([line[0], line[2], line[3], line[1]]))
    return out


def search_data(command, search_list):
    if ',' in command:
        line = command.split(',')
    elif ' ' in command:
        line = command.split(' ')
    else:
        line = [command]
    for i in range(len(search_list)):
        search_list[i] = search_list[i].split('\t')
    result = np.array(search_list)
    list_dic = []
    for i in range(len(line)):
        list_dic.append({})
    for i in range(len(line)):
        word = line[i]
        for j in range(len(result)):
            if word == result[j, 0]:
                list_dic[i][result[j, 0] + '\t' + result[j, 1] + '\t' + result[j, 2] + '\t' + result[j, 3]] = 0
            elif word == result[j, 1]:
                list_dic[i][result[j, 0] + '\t' + result[j, 1] + '\t' + result[j, 2] + '\t' + result[j, 3]] = 0
            elif word == result[j, 2]:
                list_dic[i][result[j, 0] + '\t' + result[j, 1] + '\t' + result[j, 2] + '\t' + result[j, 3]] = 0
    out_dic = list_dic[0]
    for i in list_dic:
        out_dic = dict(out_dic.items() & i.items())
    out = []
    for key in out_dic:
        out.append(key)
    return out


def standard_file(file):
    with open(file, 'r') as u:
        lines = u.readlines()
    result = ''
    for i in lines:
        i = i.strip('\n')
        if i and i[0] == '>':
            result = result + '\n' + i + '\n'
        else:
            result = result + i
    result = result[1:].split('\n')
    out = ''
    for line in result:
        if '>' in line:
            if '-' not in line:
                out += '\n' + line.split(':')[0].split(' ')[0].split('|')[0].lower() + '-NA' + '\n'
            else:
                out += '\n' + line.split('-')[0].split(':')[0].split(' ')[0].split('|')[0].lower() + '-' + '-'.join(line.split('-')[1:]) + '\n'
        else:
            out += line
    with open(os.path. join(download_path, 'stand_' + os.path.split(file)[-1]), 'w', encoding='UTF-8') as f:
        f.write(out[1:])
    return os.path. join(download_path, 'stand_' + os.path.split(file)[-1])


def get_list(data):
    out = []
    for line in data:
        line = line.split('\t')
        if line[1] not in out:
            out.append(line[1])
    return out


def part_data(li_1, size_1):
    size_list_1 = []
    size_index_1 = []
    if '/' in size_1:
        size_list_1.append([0, int(float(size_1.split('/')[0])*li_1)])
        size_index_1.append(size_1.split('/')[0])
        size_list_1.append([int(float(size_1.split('/')[0])*li_1), li_1])
        size_index_1.append(size_1.split('/')[-1])
    else:
        gap = int(round(li_1*float(size_1), 0))
        t = 0
        for i in range(int(1/float(size_1))-1):
            size_index_1.append(str(i))
            size_list_1.append([t, t + gap])
            t += gap
        size_list_1.append([t, li_1])
        size_index_1.append(str(i+1))
    return size_list_1, size_index_1


def split_data(file_1, size_1, data):
    if file_1 not in os.listdir(download_path):
        os.makedirs(os.path.join(download_path, file_1))
    list_1 = []
    for i in data:
        i = i.split('\t')
        if file_1 == i[1]:
            list_1.append(os.path.join(os.path.join(data_path, i[1]), i[2]))
    size_list_1, size_index_1 = part_data(len(list_1), size_1)
    out_path = []
    for i in range(len(size_list_1)):
        key1 = size_list_1[i]
        name = size_index_1[i]
        out1 = ''
        for path in list_1[key1[0]:key1[1]]:
            with open(path, 'r') as f:
                out1 += f.read() + '\n'
        with open(os.path.join(os.path.join(download_path, file_1), file_1 + '&' + name + '.fasta'), 'w') as f:
            f.write(out1)
        out_path.append(os.path.join(os.path.join(download_path, file_1), file_1 + '&' + name + '.fasta'))
    return '\n'.join(out_path)


def save_data(data, name=None):
    path = []
    for i in data:
        i = i.split('\t')
        path.append(os.path.join(os.path.join(data_path, i[1]), i[2]))
    out = ''
    for each in path:
        with open(each, 'r') as f:
            out += f.read() + '\n'
    if name == None:
        name = visual_timestamp() + '.fasta'
    with open(os.path.join(download_path, name), 'w') as f:
        f.write(out)
    return os.path.join(download_path, name)







